import React from 'react';
import Timer from './Timer';
import YouTubeEmbed from './YouTubeEmbed.js';
import './App.css';

function App() {
  return (
    <div className="App">
    <div className="Timer">
      <Timer/>
      </div>

      <div className="Youtube">
      <YouTubeEmbed />
      </div>
    </div>
  )
}

export default App;
